import './Orders.scss';
import HeadOrder from "./HeadOrder/HeadOrder";
import Order from "./Order/Order";
import {useEffect, useState} from "react";
import {getOrders} from "../../redux/orders-reducer";

const Orders = (props)=> {
    const [offSet, setOffSet] = useState(props.order.offset);

    useEffect(() => {
        // props.getOrders(props.order.offset)
    });

    let orderLinks = props.order.orders.map(item => <Order
        key={item.orderId}
        orderId={item.orderId}
        // orderName={item.establishmentName}
        // orderLocation = {item.establishmentLocation}
        // orderData = {item.createDate}
        // orderCost = {item.deliveryCost}

    />)
    return (
      <div className='orders-container'>
            <HeadOrder/>
          {orderLinks}
          <div>
              {props.order.orders.length<5?<button onClick={()=>setOffSet(offSet+5)} >Load more</button>:<button>Load more</button>}
          </div>
      </div>
    )
}

export default Orders;
